  const hanas = props.kyePrac.map((hana) => <div>{hana.name}</div>);

  const [title, setTitle] = useState();
  const [content, setContent] = useState();

  function newMemo() {
    props.setMemo([...props.memo]);
  }

  return <div></div>;
}

export default CreateMemo;
